(() => {

    const openScore = -5;
    const continueScore = -1;


    //the scoring table value is stored in nested object with key as a parameter

    let solution = {};

    let solutionArray = [
        [1, -5, -5, -1],
        [-5, 1, -1, -5],
        [-5, -1, 1, -5],
        [-1, -5, -5, 1]
    ];
    let solutionCharacter = ['A', 'T', 'C', 'G'];

    for (let i = 0; i < 4; i++) {
        solution[solutionCharacter[i]] = {};
        for (j = 0; j < 4; j++) {
            solution[solutionCharacter[i]][solutionCharacter[j]] = solutionArray[i][j];
        }
    }

    //-----------------------------------------------------------------------------------

    let str1 = "";
    let str2 = ""
    let n = str1.length;
    let m = str2.length;
    let caches = [];
    let DeleteA = [];
    let DeleteB = [];
    for (let i = 0; i <= n; i++) {
        caches[i] = [];
        DeleteA[i] = [];
        DeleteB[i] = [];
        for (let j = 0; j <= m; j++) {
            caches[i][j] = -9999;
            DeleteB[i][j] = -9999;
            DeleteA[i][j] = -9999;
        }
    }

    const sequencing = (n, m) => {
        let i, j;

        //iterating through all the possible combination or node of root
        for (i = 0; i <= n; i++) {
            for (j = 0; j <= m; j++) {
                //basecondition
                if (i == 0 && j == 0) {
                    caches[0][0] = 0;
                } else {
                    if (i == 0) {
                        caches[0][j] = openScore + continueDeleteB(0, j - 1);
                    } else if (j == 0) {
                        caches[i][0] = openScore + continueDeleteA(i - 1, 0);
                    } else {
                        //explore all three/four option and find the step that gives maximum value
                        caches[i][j] = Math.max(openScore + continueDeleteB(i, j - 1),
                            openScore + continueDeleteA(i - 1, j),
                            solution[str1[i - 1]][str2[j - 1]] + caches[i - 1][j - 1]);
                    }

                }

            }
        }
        //return the solution at the end of the array; i and j is decremeneted 1 as
        // it is n+1 and m+1 after returning from 'for loop' breaking condition
        return caches[i - 1][j - 1];

    }


    const continueDeleteA = (n, m) => {
        //base case
        if (n == 0) {
            DeleteA[0][m] = caches[0][m];
        }
        //if value is not precalculated
        if (DeleteA[n][m] == -9999) {
            DeleteA[n][m] = Math.max(continueScore + DeleteA[n - 1][m], caches[n][m]);
        }
        //otherwise
        return DeleteA[n][m];
    }

    const continueDeleteB = (n, m) => {
        //base case
        if (m == 0) {
            DeleteB[n][0] = caches[n][0];
        }
        //if value of deleteB is not precalculated
        if (DeleteB[n][m] == -9999) {
            DeleteB[n][m] = Math.max(continueScore + DeleteB[n][m - 1], caches[n][m]);
        }
        //otherwise
        return DeleteB[n][m];

    }
    console.time('DP_TIME');
    console.log(sequencing(n, m));
    console.timeEnd('DP_TIME');



    //backtracking by checking the value of the caches array

    const trackBack = () => {

        //we start backward i.e from [n-1,m-1] all toward [0,0]
        let i = n;
        let j = m;
        const trackPath = [];

        //go until we reach the start of array
        while (i != 0 && j != 0) {

            //if it is replaced by another character or just copied/ done nothing
            if (caches[i][j] == (caches[i - 1][j - 1] + solution[str1[i - 1]][str2[j - 1]])) {
                //solution is 1 at that character combination in scoring table mean it was same character at two string
                if (solution[str1[i - 1]][str2[j - 1]] == 1) {
                    trackPath.push(`both character are same no substitution need`);
                } else {
                    trackPath.push(`${str1[i]} is substituted to ${str2[j]}`);
                }
                i--;
                j--;
            }

            //if the character at A is deleted
            if (caches[i][j] == DeleteA[i][j]) {
                trackPath.push(`${str1[i-1]} is deleted from string A`);
                i--;
            }

            //if the character at B is deleted
            if (caches[i][j] == DeleteB[i][j]) {
                trackPath.push(`${str2[i-1]} is deleted from second string B`);
                j--;
            }
        }
        return trackPath;

    }

    // console.log(trackBack());
})()